import React from 'react'

export default function Navbar() {
    return (
      <div className='navbar'>
        <div className='logo'>
          <img src='./images/dice-logo.png' alt='Nike Logo'/>
        </div>
        <div className='game-name'>
        Dice Game
        </div>
      </div>
    );
  }
